svg.script:
(function () {
  "use strict";

  function init(){
    var docs = document.getElementById('docs');
    var ethereum = document.getElementsByClassName('ethereum');
    var tl = new TimelineMax({repeat:-1});

    tl.set(docs, {x:200, y:2850, autoAlpha:0});
    tl.to(docs, .4, {x:340, y:2950, autoAlpha:1, ease:Power0.easeNone});
    tl.to(docs, .7, {x:742, y:2700, ease:Power0.easeNone});
    tl.to(docs, .4, {x:623, y:2623, ease:Power0.easeNone});
    tl.to(docs, .4, {x:623, y:2550, ease:Power0.easeNone, delay:.2});
    tl.to(docs, .4, {autoAlpha:0, ease:Power0.easeNone, delay:-.4});

    TweenMax.staggerTo(ethereum, .5, {y:'+=20', ease:Power2.easeInOut, yoyo:true, repeat:-1}, .05, 0);

    tl.to({}, .5, {});
  }

  window.addEventListener('load', init);
}());
